contents:
행동 경제학에는 확률가중함수와 가치함수라는 것이 존재한다. 자세한 내용들은 서적이나 검색을 통해 알 수 있겠지만, 간단히 설명하면 아래와 같다.

확률가중함수확률에 대해 사람들이 가중치를 두어 생각한다는 것을 보여주는 함수가치함수사람의 손실회피 성향을 보여주는 것으로, 손실에 대해서 더 많은 가치 부여를 보이는 경향을 보임



#확률 가중 함수
w_p = function(p,r=0.65){
  if(p<0){
    k = p * (-1)
    return((k**r)/((k**r)+(1-k)**r)**(1/r)*(-1) * 2.25)
  }
  if(p>0){
    return((p**r)/((p**r)+(1-p)**r)**(1/r))
  }
  if(p==0){
    return(0)
  }
}

# 가치 함수
value_f = function(x){
    if(x>=0){
        y = x**0.88
    }
    if(x<0){
        y = -2.25*(-x)**0.88
    }
    return(y)
}

#확률리스트 생성
p_list = seq(0,1,by=0.01)
p_df = data.frame(p_list)
p_df$W_P = unlist(Map(w_p, p_list))
head(p_df)


  p_list        W_P
1   0.00 0.00000000
2   0.01 0.04693333
3   0.02 0.07132103
4   0.03 0.09057428
5   0.04 0.10699114
6   0.05 0.12152793

library(ggplot2)
ggplot() + geom_point(data=p_df, aes(x=1:nrow(p_df), y=p_list), col='blue')+
  geom_point(data=p_df, aes(x=1:nrow(p_df), y=W_P), col='red')+
  xlab('real prob(%)')+
  ylab('Probability of feeling') + theme_bw()
